// pragma solidity 0.5.16;
pragma solidity ^0.5.0;

import "./CustomToken.sol";


contract LedToken is CustomToken {
    uint8 private DECIMALS = 4; //  
    uint256 private MAX_TOKEN_COUNT = 1000000000; //   
    uint256 private MAX_SUPPLY = MAX_TOKEN_COUNT * (10**uint256(DECIMALS)); //  
    uint256 private INITIAL_SUPPLY = (MAX_SUPPLY * 1) / 1; //  
    string private TOKEN_NAME = "Ledgis"; //  
    string private TOKEN_SYMBOL = "LED"; //  

    bool private issued = false;

    constructor() public CustomToken(TOKEN_NAME, TOKEN_SYMBOL, DECIMALS, MAX_SUPPLY) {
        require(issued == false, "token already minted");
        super.mint(msg.sender, INITIAL_SUPPLY);
        issued = true;
    }
}
